import React, { Component } from "react";
import { Helmet } from 'react-helmet'

export default class About extends Component {
    render() {
        const theme = {
            color: 'white',
            fontSize: '50px',
            marginTop: '400px',
            fontFamily: 'ariel thin'

        };
        return (

            <div>
                <Helmet bodyAttributes={{ style: "background-color: black" }} />
                <p style={theme}>
                    Lea Hughes is an Austin based composer with work featured in various TV/Film projects. She enjoys creating
        </p>
            </div>
        );
    }
}
